import styles from "./Rodape.module.css"

function Rodape() {
    return (
        <footer className={styles.rodape}>
            <a href="https://www.linkedin.com/in/carlos-vinícius-bezerra-sampaio-b6a302254/" target="_blank" rel="noreferrer"><h3>Desenvolvido por Carlos Vinícius Bezerra Sampaio</h3> </a>
        </footer>
    )

}

export default Rodape;
